import React from 'react';
import { musicalInstruments } from '../data/musicalInstruments';
interface ViewProps {
  id: number;
}

export default class View extends React.Component<ViewProps, any> {

  constructor(props: ViewProps) {
    super(props);
  }

  render() {
    const { id } = this.props;
    return <div>
      <h1>{musicalInstruments[parseInt(id)].instrument}</h1>
      <p>{musicalInstruments[parseInt(id)].description}</p><br />
      <p>price: {musicalInstruments[parseInt(id)].price}</p>
    </div>
  }
